import React, {useState} from "react";
import {Link} from "react-router-dom";
import Dropdown from "./dropdown";
import animals from '../data/animals.json'

export default function DoctorSearch() {
  const [value, setValue ] = useState(null)
  return (
    <>
      <Dropdown>
        <Dropdown.Toggle id='diag-search'>
        Search for Tests and Profiles
        </Dropdown.Toggle>

        <Dropdown.Menu id="d-menu">
        <Dropdown.Item prop="Search for Doctors or Symptoms." id='d-item' options={animals} value={value} label='name' onChange={val => setValue(val)}>
          <Link as={Link} to="/pharmacy-search"></Link>
        </Dropdown.Item>
        </Dropdown.Menu>

      </Dropdown>
    </>
  ) 
 
}
